import logo from "./logo.svg";
import "./App.css";
import { ReactComponent as Logo } from "./assets/logos.svg";

function App() {
	return (
		<div className="bg-[#19173D] h-screen ">
			<div className="bg-[#262450] w-full py-2 px-5">
				<Logo width={48} />
			</div>
			<div className="h-full  flex justify-center items-center mx-4">
				<div className="bg-[#262450] text-white w-full md:min-w-96 mid:min-h-96 min-h-64  flex justify-center items-center rounded-2xl md:px-24 ">
          <p>Login</p>

				</div>
			</div>
		</div>
	);
}

export default App;
